import React from 'react';
import { Instagram, Twitter, Linkedin, Dribbble } from 'lucide-react';

export default function Footer() {
  return (
    <footer className="border-t border-gray-800 py-4">
      <div className="max-w-6xl mx-auto px-4 flex justify-between items-center">
        <div className="text-lg font-light">
          COLOR<span className="text-[#EC7B2F]">STENCIL</span>
        </div>

        <div className="flex gap-3">
          <a href="#" className="w-9 h-9 border border-gray-700 rounded flex items-center justify-center hover:border-[#EC7B2F] hover:text-[#EC7B2F] transition-all duration-300">
            <Instagram size={16} />
          </a>
          <a href="#" className="w-9 h-9 border border-gray-700 rounded flex items-center justify-center hover:border-[#EC7B2F] hover:text-[#EC7B2F] transition-all duration-300">
            <Twitter size={16} />
          </a>
          <a href="#" className="w-9 h-9 border border-gray-700 rounded flex items-center justify-center hover:border-[#EC7B2F] hover:text-[#EC7B2F] transition-all duration-300">
            <Linkedin size={16} />
          </a>
          <a href="#" className="w-9 h-9 border border-gray-700 rounded flex items-center justify-center hover:border-[#EC7B2F] hover:text-[#EC7B2F] transition-all duration-300">
            <Dribbble size={16} />
          </a>
        </div>

        <div className="text-gray-400 text-sm font-light">
          © 2024 Color Stencil. All rights reserved.
        </div>
      </div>
    </footer>
  );
}
